import React from "react";

export class SignUpComponent extends React.Component{


    setPassword = (event )

    checkIfPasswordMatch = (event) =>{
        console.log(event.target.value)
    }

    render(){
        return(
            <>
                <div className="register_div">
                    <form className="register_form">
                        <div className="form-group" id="first_group">
                            <input type="text" placeholder="First Name"  title="Enter username or email" autoComplete="false"  className="form-control" id="firstName"/>
                            <input type="text" placeholder="Last Name" title="Enter username or email" autoComplete="false"  className="form-control" id="lastName"/>
                            <input type="text" placeholder="Email" title="Enter username or email" autoComplete="false"  className="form-control" id="inputEmail"/>
                        </div>
                        <div className="form-group" id="second_group">
                            <input type="text" placeholder="Username" title="Enter username or email" autoComplete="false"  className="form-control" id="inputUsername"/>
                            <input type="password" onChange={this.setPassword} placeholder="Password" className="form-control" autoComplete="false" id="inputPassword"></input>
                            <input type="password" onChange={this.checkIfPasswordMatch} placeholder="Confirm Password" className="form-control" autoComplete="false" id="confirmPassword"></input>
                        </div>
                        <button type="button" className="btn btn-primary" >Submit</button>
                    </form>
                </div>
            </>
        )
    }
}
